sympy.sympy.core.containers.__eq__:
def __eq__(self, other):
    if isinstance(other, Basic):
        return super().__eq__(other)
    return self.args == other

sympy.sympy.core.decorators.binary_op_wr:
@wraps(func)
def binary_op_wrapper(self: T1, other: T2) -> T3:
    if hasattr(other, '_op_priority'):
        if other._op_priority > self._op_priority:  # type: ignore
            f: Union[Callable[[T1], T3], None] = getattr(other, method_name, None)
            if f is not None:
                return f(self)
    return func(self, other)

sympy.sympy.core.decorators._func:
@wraps(func)
def _func(self, other):
    # XXX: The check for _op_priority here should be removed. It is
    # needed to stop mutable matrices from being sympified to
    # immutable matrices which breaks things in quantum...
    if not hasattr(other, '_op_priority'):
        try:
            other = sympify(other, strict=True)
        except SympifyError:
            return retval
    if not isinstance(other, expectedcls):
        return retval
    return func(self, other)

sympy.sympy.core.function.__eq__:
def __eq__(self, other):
    if not isinstance(other, Subs):
        return False
    return self._hashable_content() == other._hashable_content()

sympy.sympy.core.mul.__neg__:
def __neg__(self):
    c, args = self.as_coeff_mul()
    if args[0] is not S.ComplexInfinity:
        c = -c
    if c is not S.One:
        if args[0].is_Number:
            args = list(args)
            if c is S.NegativeOne:
                args[0] = -args[0]
            else:
                args[0] *= c
        else:
            args = (c,) + args
    return self._from_args(args, self.is_commutative)

sympy.sympy.core.numbers.__eq__:
def __eq__(self, other):
    try:
        other = _sympify(other)
    except SympifyError:
        return NotImplemented
    if self is other:
        return True
    if other.is_Number and self.is_irrational:
        return False

    return False    # NumberSymbol != non-(Number|self)

sympy.sympy.core.numbers.__lt__:
def __lt__(self, other):
    try:
        other = _sympify(other)
    except SympifyError:
        return NotImplemented
    if other.is_Integer:
        return _sympify(self.p < other.p)
    return Rational.__lt__(self, other)

sympy.sympy.logic.boolalg.__eq__:
def __eq__(self, other):
    if other is True:
        return False
    if other is False:
        return True
    return super().__eq__(other)

sympy.sympy.matrices.repmatrix.__eq__:
def __eq__(self, other):
    # Skip sympify for mutable matrices...
    if not isinstance(other, RepMatrix):
        try:
            other = _sympify(other)
        except SympifyError:
            return NotImplemented
        if not isinstance(other, RepMatrix):
            return NotImplemented

    return self._rep.unify_eq(other._rep)

sympy.sympy.physics.vector.frame.__eq__:
def __eq__(self, other):
    # Check if the other object is a CoordinateSym of the same frame and
    # same index
    if isinstance(other, CoordinateSym):
        if other._id == self._id:
            return True
    return False
